INSERT INTO `en_article` VALUES (4,22,'为什么新浪微博广告屡遭骂名而豆瓣广告收获好评？','','http://www.yuanda360.com/demo/file/2013/06/51c52009459ad.jpg','什么,新浪,微博,广告,屡遭,骂名,豆瓣,获好评,橘生,淮南,则为','橘生淮南则为橘，生于淮北则为枳，这句话在社交网络的广告上同样适用。打开新浪微博和豆瓣，你会看到两种风格完全不同的广告，下面随便拿出一些对比。 前者为新浪微博上的推广广告，后者为豆瓣上的硬广推广。二者的差别？我想不用多做解释了吧。看了二者的广告，你可能','/index.php?a=shows&catid=22&id=4',0,99,1,0,'admin',1371873289,1371873289,0,'','新浪微博',0,0,0,0,0,0),(5,22,'大众点评网遭“黑”手：网页跳转至天猫','','http://www.yuanda360.com/demo/file/2013/06/51c52313391d9.jpg','大众点评,大众点评被黑客攻击,网页跳转至天猫','昨天凌晨，很多大众点评网的用户登录网站时发现无法打开网页，取而代之的是一个写着QQ号的弹窗，随后跳转至天猫页面，导致一些在点评网团购付款成功的用户订单延误。众多用户纷纷吐槽此次网站被黑事件，而QQ号指向的黑客helen则否认是其所为。','/index.php?a=shows&catid=22&id=5',0,99,1,0,'admin',1371874073,1371874073,0,'','大众点评',0,0,0,0,0,0),(6,22,'狗狗搜索宣布关站 版权问题难解','','http://www.yuanda360.com/demo/file/2013/06/51c5236ccba0e.jpg','狗狗搜索,宣布关站,版权问题','【搜狐IT消息】（小蕊）5月2日消息，狗狗搜索今日宣布暂停gougou.com网站服务，具体原因未知，版权问题恐怕依旧是难解之痛。 狗狗搜索是提供影视剧、电子书、软件、音乐下载的搜索引擎，2004年由李学凌创办，曾获得雷军100万人民币投资，2007年被卖给迅雷。','/index.php?a=shows&catid=22&id=6',0,99,1,0,'admin',1371874160,1371874160,0,'','狗狗搜索 迅雷',0,0,0,0,0,0),(7,22,'反击易迅 京东欲推一日四送','','http://www.yuanda360.com/demo/file/2013/06/51c523a819ded.jpg','易迅 京东 一日四送','一日四送 极速达一日四送服务，将实现三个小时商品送达，比之前的211限时达快出两倍 一日三送 早上订单在下午2时之前送达，中午订单在晚上6时之前送达，晚间订单在晚上10时之前送达 继价格战后，一对电商 冤家对头京东和易迅又将竞争的焦点对准到了物流速度上。','/index.php?a=shows&catid=22&id=7',0,99,1,0,'admin',1371874216,1371874216,0,'','易迅 京东',0,0,0,0,0,0),(37,34,'G33','','/uploads/content/2017/10/59f822ff4fd8a.png','','1','/show-34-37.html',0,99,1,0,'admin',1516873839,1516873839,0,'','',0,0,0,0,0,0);
