INSERT INTO `en_article_data` VALUES (4,'<p style=\"text-indent:2em;\">橘生淮南则为橘，生于淮北则为枳，这句话在社交网络的广告上同样适用。打开新浪微博和豆瓣，你会看到两种风格完全不同的广告，下面随便拿出一些对比。</p><p><br/></p><p><img border=\"0\" height=\"427\" src=\"http://www.yuanda360.com/demo/file/2013/06/51c52009459ad.jpg\" width=\"520\" style=\"border:1px solid #999999;max-width:680px;display:block;margin-left:auto;margin-right:auto;\" /></p><p style=\"text-indent:2em;\">前者为新浪微博上的推广广告，后者为豆瓣上的硬广推广。二者的差别？我想不用多做解释了吧。看了二者的广告，你可能会顿生感慨：在新浪微博这个粗暴发展的地方，连广告也是粗暴的，而在豆瓣这个文艺的地方，连广告也是文艺的。</p><p style=\"text-indent:2em;\">作为一个公关人，虽然我对新浪微博的广告持理解态度，但偶尔也会对它的推广感到反感，比如上面那个淘宝广告，这广告真的是对我——一名男士的精准投放吗？与新浪微博广告相比，豆瓣的广告并不惹人反感，相反，有时候还很讨人喜欢。这不只是我一个人的体验，很多身边经常上豆瓣的人，也多表示没有受到豆瓣广告的什么干扰。</p><p style=\"text-indent:2em;\">那么为什么豆瓣的广告很少有人否定，而新浪微博广告却一直背负骂名呢？</p><p style=\"text-indent:2em;\">粗暴的新浪微博广告与精准的豆瓣广告</p><p style=\"text-indent:2em;\">新浪微博的主要广告类别有微博顶部广告、底部广告、侧栏广告等形式，其中最粗暴的是微博推广（包括粉丝通和橱窗硬广广告），如果说顶部、底部和侧栏广告还类似于电视剧开播前的广告的话，那微博推广就像是直接在电视剧中插播广告了，话说现在电视剧都不在播放途中插播广告了，而微博却反其道而行之，这种“粗暴插播”的广告形式，严重影响了用户体验，遭来骂名也是必然的。</p><p style=\"text-indent:2em;\">豆瓣的广告与微博差别显著，它的主要类别有豆瓣读书右侧的电商购买网站（如亚马逊、当当等），豆瓣电影关联的在线选座购票链接（其中有各大电影院的电影票网上购买），豆瓣同城中的活动购票链接（包括演唱会、沙龙等），以及豆瓣电台中的广播广告和各个页面的硬广推广等。</p><p style=\"text-indent:2em;\">这其中前三种（豆瓣图书、电影、同城中的购买链接）广告形式，丝毫不会影响用户的体验，相反，它们通过这种形式，使想购买产品的人快捷方便地找到产品的购买链接并完成购买，有效地提升了用户的体验。</p><p style=\"text-indent:2em;\">豆瓣电台中的广播广告是相对比较硬的广告，它类似于收音机中的插播广告。但有三点决定用户并不会对这种广告耿耿于怀。第一是用户在收听豆瓣电台的30分钟内不会听到广告，这基本上是可以让部分用户接受的时间。第二是付费用户（每月10元）可以收听它的高音质+无广告版。第三是豆瓣电台是个优秀的产品，它推荐音乐的精准度是非常高的，以听点广告的代价，换来豆瓣电台精准的音乐推荐服务，这对大多数人来说是一个划算的买卖。</p><p style=\"text-indent:2em;\">豆瓣的硬广推广可能是所有广告形式中最硬的，相对来说也是对用户影响最大的。但它与新浪微博硬广不同的地方有两点。第一是广告统一置于页面的右上侧，这使得豆瓣的页面看起来至少是整洁的。第二是广告的整体风格清新、文艺，总体符合豆瓣的调性，基本上毫无违和感。看了豆瓣广告，再看新浪微博广告，会让人感觉是从设计精致的商场来到了卖地摊货的地下通道。豆瓣硬广的这两个特点使其并没有受到用户的大面积反感，相反不少用户还对这些广告称赞有加。</p><p style=\"text-indent:2em;\">新浪微博广告与豆瓣广告对比</p><p style=\"text-indent:2em;\">名称形式广告位特点</p><p style=\"text-indent:2em;\">新浪微博广告页面硬广+微博推广多处粗暴展示+插入</p><p style=\"text-indent:2em;\">豆瓣广告页面硬广+购买链接+电台硬广统一置于右侧温和展示+需要时提供</p><p style=\"text-indent:2em;\">通过以上分析可以发现豆瓣广告与新浪微博广告最大的差别有两个，其一为二者属性不同，豆瓣广告是在需要时提供，而新浪微博广告是强行提供，有人可能要说在大数据时代，精准广告推送是未来的趋势，但不管未来怎样，现在新浪微博的广告完全谈不上精准；其二为二者的视觉效果不同，豆瓣广告形式整洁、有序、文艺，符合豆瓣调性，而新浪微博广告杂乱、无序，不一定符合新浪微博调性。</p><p style=\"text-indent:2em;\">所以总体来说，新浪微博是在用传统广告的思维做广告，而豆瓣是在用社会化广告的思维做广告（关于此点可以参看之前的文章《像做产品一样做广告》。</p><p style=\"text-indent:2em;\">新浪微博广告应将步伐放慢一点</p><p style=\"text-indent:2em;\">吴军曾在《浪潮之巅》中提出一个适用互联网公司的基因决定论，豆瓣广告之所以与新浪微博广告差别明显，本质上也是因为二者基因不同，豆瓣是一家拥有文艺范的慢公司，而新浪是一家拥有媒体属性的快公司。</p><p style=\"text-indent:2em;\">豆瓣这一拥有8年多历史的公司，<span style=\"color:#222222;font-size:14px;line-height:26px;text-indent:28px;background-color:#ffffff;\"></span>仅仅在3年前才推出了展示类广告，从这不难看出豆瓣对用户体验的极端重视，它不会像新浪微博那样因为急于盈利而在许多方面忽视用户的体验。广告门在对于豆瓣的一篇报道中写道：豆瓣对广告客户有着坚持——要用豆瓣的语言与用户交流。</p><p style=\"text-indent:2em;\">慢基因决定了豆瓣对于广告客户的苛求，决定了豆瓣的广告没有偏离豆瓣轨迹且没有影响用户体验的结果。</p><p style=\"text-indent:2em;\">而快基因使新浪微博行走的步伐一直很快，但有时行走的太快容易忘掉出发时的初衷。新浪或许应该停下来思考一些问题，比如：为什么自己的广告被无数人骂，而豆瓣的广告却没人骂？</p><p><br /><br /></p>',2,10000,'',0,1,'',''),(5,'<p style=\"text-align:center\"><img alt=\"大众点评网遭“黑”手：helen否认与其有关\" src=\"http://www.yuanda360.com/demo/file/2013/06/51c523191dbf4.jpg\" style=\"font-family:arial, verdana, sans-serif;border:0px;max-width:680px;width:409px;height:173px;\" /></p><p style=\"text-align:center\"><img alt=\"大众点评网遭“黑”手：helen否认与其有关\" src=\"http://www.yuanda360.com/demo/file/2013/06/51c5231984627.jpg\" style=\"border:0px;max-width:680px;\" /></p><p style=\"text-indent:2em;\">昨天凌晨，很多大众点评网的用户登录网站时发现无法打开网页，取而代之的是一个写着QQ号的弹窗，随后跳转至“天猫”页面，导致一些在点评网团购付款成功的用户订单延误。众多用户纷纷吐槽此次网站被黑事件，而QQ号指向的黑客helen则否认是其所为。</p><p style=\"text-indent:2em;\">用户上网卡壳</p><p style=\"text-indent:2em;\">“大概晚上11点40多，我打开大众点评网，但是浏览器马上就报错了，弹出了一个对话框上面写着四字：‘凛冬将至’。网页上还有署名‘Helen’的黑客留下了一个QQ号。”大众点评网的用户王先生称自己看见后一时有点蒙，不知道是什么情况。“我上网一搜，原来大家都在说大众点评上不去的事情，有些人跳转完直接出现网址导航网站。”</p><p style=\"text-indent:2em;\">使用手机客户端的用户也同样遭遇了应用瘫痪的悲剧。“我手机上的大众点评网应用打开之后一直在内容载入中，登录也反复失败，我用手机号找回密码后收到的短信是乱码。”用户孙女士称自己本以为是手机出了问题，打开了其他应用程序才知道是大众点评网的问题。</p><p style=\"text-indent:2em;\">直到昨天清晨7点多，大众点评网站和手机客户端才恢复正常使用。</p><p style=\"text-indent:2em;\">网友订单延误</p><p style=\"text-indent:2em;\">由于网页的突然瘫痪，许多用户在提交订单付款后却无法再次确定付款成功和领取认证码。直到昨天清晨网页恢复正常后，用户再次登录成功却发现订单上没有付款成功的提示。“交了钱却没有给商户提供的验证码，在订单上也写着未付款成功，这是怎么回事？”王先生称自己的网银短信提示扣款成功，的确已经付款。</p><p style=\"text-indent:2em;\">“我给大众点评网的客服打电话，40分钟没有打进去，一直是线路忙，等待。”王先生无奈下使用了俗称“呼死你”的电话软件，却一直没有能打通热线电话。直到昨天上午9点半左右，大众点评客服官方微博称：“热线繁忙，电话排队中。烦请各位小点友耐心等待，如有问题可以私信给@大众点评网客服。”记者尝试拨打客服热线发现，直到中午11点多，客服热线基本恢复正常。</p><p style=\"text-indent:2em;\">helen否认与其有关</p><p style=\"text-indent:2em;\">对于网站的瘫痪，大众点评官方微博在昨天凌晨称：“因域名注册商出现系统漏洞，导致大众点评域名指向出现错误，这不会对用户造成任何信息安全方面的影响，广大用户可以放心。目前我们正努力联系域名注册商尽快修复他们的系统漏洞，以便尽快恢复大众点评的服务。对给用户造成的不便，我们深表歉意！”</p><p style=\"text-indent:2em;\">记者访问了网页中留下QQ号的黑客helen的空间，却发现他在昨天发布了一条声明，称自己并不是制造此次事故的黑客。“本人再次申明一点，在圈内我的名气很大，哥确实黑了国内不少安全小组的网站，也得罪了非常多的人，但是哥在国内只弄黑客站，基本不去碰其他网站的。哥专注国外网络安全已多年，所以很少在去关注国内网络安全。那些诬陷我的人，小心了。”记者随后联系helen，但其一直未予回应。</p><p><br /></p>',2,10000,'',0,1,'',''),(6,'<p style=\"text-align:center\"><img border=\"0\" height=\"262\" src=\"http://www.yuanda360.com/demo/file/2013/06/51c52370829ae.png\" width=\"600\" style=\"border:1px solid #999999;max-width:680px;display:inline-block;\" /></p><p style=\"text-indent:2em;\">【搜狐IT消息】（小蕊）5月2日消息，狗狗搜索今日宣布暂停gougou.com网站服务，具体原因未知，版权问题恐怕依旧是难解之痛。</p><p style=\"text-indent:2em;\">狗狗搜索是提供影视剧、电子书、软件、音乐下载的搜索引擎，2004年由李学凌创办，曾获得雷军100万人民币投资，2007年被卖给迅雷。</p><p style=\"text-indent:2em;\">狗狗搜索给迅雷带来了不小的版权麻烦，2010年迅雷筹划上市前期，狗狗搜索被迅雷以1万元卖给非关联第三方。</p><p style=\"text-indent:2em;\">狗狗搜索曾经多次关站，又多次重开。2011年4月，文化部联合广告总局下令狗狗搜索下令关闭整改；2011年11月，狗狗搜索公告因系统调整暂停网站服务；2011年12月初恢复访问之后，当月底又再次宣布停止服务。</p><p style=\"text-indent:2em;\">狗狗搜索官方并未对本次关站的原因做出说明，未来是否会再次重开也尚不清楚。</p><p><br /></p>',2,10000,'',0,1,'',''),(7,'<p style=\"text-align:center\"><img alt=\"京东反击易迅欲推一日四送 易迅回应：欢迎竞争\" src=\"http://www.yuanda360.com/demo/file/2013/06/51c523a819ded.jpg\" style=\"border:0px;max-width:680px;\" /></p><p style=\"text-indent:2em;\">一日四送</p><p style=\"text-indent:2em;\">“极速达”一日四送服务，将实现三个小时商品送达，比之前的“211限时达”快出两倍</p><p style=\"text-indent:2em;\">一日三送</p><p style=\"text-indent:2em;\">早上订单在下午2时之前送达，中午订单在晚上6时之前送达，晚间订单在晚上10时之前送达</p><p style=\"text-indent:2em;\">继价格战后，一对电商 “冤家对头”——京东和易迅又将竞争的焦点对准到了物流速度上。继去年12月易迅大举杀入京东大本营北京，并将“一日三送”服务扩展到北京市场后，昨日又传出消息称，京东近期正在紧锣密鼓地筹备“极速达”的一日四送服务，号称将实现三个小时商品送达，比之前的“211限时达”快出两倍。此举被业内认为是针对易迅的直接挑战。</p><p style=\"text-indent:2em;\">易迅网负责人表示，“电商的物流不仅要快速，更关键的还在于稳定和准时，我们期待和更多的企业一起不断提升面向消费者的服务，易迅非常欢迎竞争。”</p><p style=\"text-indent:2em;\">事件</p><p style=\"text-indent:2em;\">京东欲在京推“一日四送”</p><p style=\"text-indent:2em;\">配送速度一直是电商差异化竞争的焦点，从最早的三日送达，到隔日达，再到京东的“211”，以及目前易迅所保持的一日三送，电商巨头们在物流速度上进行的是内功的比拼。</p><p style=\"text-indent:2em;\">去年底，易迅高调宣布杀入京东大本营北京市场，一时间北京地铁公交上“在北京，谁比易迅更快”的广告铺天盖地，短期内带动了易迅在北京订单量的快速上扬，此举也使得京东颇为紧张，甚至在年初的内部会议上提出了“防易迅”的说法。</p><p style=\"text-indent:2em;\">京东公关媒介总监康健透露，目前“一日四送”服务只在北京试运行，即商品3小时送到。不过，对于该“一日四送”服务是否覆盖所有品类以及扩张到其他的城市，他表示由于是试运行，在品类和范围肯定有一定的限制，具体相关细节信息将会在下周公布。最后他还表示，目前试运行的品类包括有电脑类的，在北京可以到达一日四送。</p><p style=\"text-indent:2em;\">据悉，京东“极速达”配送服务已在北京地区开始试运行。之前京东依靠自有物流网络已经在一些城市先后推出211限时达、隔日达、晚间配送等服务升级措施，不过京东并没有说明在北京市场推出的一日四送服务，是否涵盖所有品类，以及是否会扩展到其他地区。</p><p style=\"text-indent:2em;\">回应</p><p style=\"text-indent:2em;\">易迅称欢迎直面竞争</p><p style=\"text-indent:2em;\">对于京东挑起的速度竞争，此前一直在国内电商物流领域领先的易迅网反应却比较平淡。</p><p style=\"text-indent:2em;\">其相关负责人在接受记者采访时表示，“电商的物流不仅要快速，更关键的还在于稳定和准时，我们期待更多的企业一起不断提升面向消费者的服务，易迅非常欢迎竞争。”</p><p style=\"text-indent:2em;\">此次京东和易迅在物流上的竞争并非首次。2005年易迅在上海推出了次日达服务，后来在京东进军上海市场后，易迅又先后将配送升级为“当日送达”，“一日两送”；在2009年京东也在上海跟进“一日两送”后，2010年易迅又果断地将配送升级为“一日三送”。2011年京东在上海也升级为“一日三送”。不过在试行一段时间后，京东取消“一日三送”服务，回归“一日两送”。</p><p style=\"text-indent:2em;\">解读</p><p style=\"text-indent:2em;\">或是针对竞争对手的炒作</p><p style=\"text-indent:2em;\">在自己大本营经营多年的京东能否通过“一日四送”来完成对易迅配送速度上的赶超？对此不少电商和物流行业专家表示了怀疑。</p><p style=\"text-indent:2em;\">中国电子商务协会物流专家、汉森世纪供应链总经理黄刚称，“京东‘一日四送’很可能是个噱头。”在他看来，易迅的一日三送已经是电商客户对于配送速度的最高需求，除非针对个别对配送速度特殊需求的商品。</p><p style=\"text-indent:2em;\">从易迅的“一日三送”来看，早上11点前的订单，过客服审单、财务出单、分区捡货，库房总拣，二次分拣到打包约需要1小时，而货车从仓库到市内配送点约需要1个小时，分单和送到快递员手中又需要40分钟的时间，这样最快的订单配送约需要3个小时的时间。而整个配送过程的不可控因素也很多，比如说仓库要离市中心足够近，即便如此道路堵塞也会影响到从仓库到配送点和从配送员到订户的速度，显然对于仓库分散而且离市区普遍较远的京东是无法具备这样的速度的。</p><p style=\"text-indent:2em;\">此外，京东目前的“211”一日两送，与其装车量、分拨量和送货量三个数据正好匹配，如果要满足“一日四送”，这些成本将大幅增加，这或是正在追求盈利的京东不愿意增加的成本。有业内人士指出，京东这次尝试的“一日四送”更多是针对竞争对手的一次炒作。 沈婷婷天府早报记者龚琼</p><p><br /></p>',2,10000,'',0,1,'',''),(37,'<p style=\"text-align: center;\"><img src=\"http://www.iqua.com/uploads/content/2017/10/59f8198d895d7.jpg\" style=\"width: 100%; \" title=\"1.jpg\" width=\"1867\" height=\"860\"/></p><p style=\"text-align: center;\"><img src=\"http://www.iqua.com/uploads/content/2017/10/59f8198d9d258.jpg\" style=\"width: 100%;\" title=\"2.jpg\"/></p><p style=\"text-align: center;\"><img src=\"http://www.iqua.com/uploads/content/2017/10/59f8198daef0a.jpg\" style=\"width: 100%;\" title=\"3.jpg\"/></p><p style=\"text-align: center;\"><img src=\"http://www.iqua.com/uploads/content/2017/10/59f8198dbddc1.jpg\" style=\"width: 100%;\" title=\"4.jpg\"/></p><p><br/></p><p><br/></p>',2,10000,'',0,1,'','');
