INSERT INTO `en_brand_story` VALUES (1,49,0,'prize','','/uploads/content/2017/10/59f16130d482e.jpg','','','1',0,'/list-52.html',4,99,1,1,'admin',1508121820,1508121820,0,0,0,0,0,0,''),(2,49,0,'BRAND STORY','','/uploads/content/2017/10/59f155b744672.jpg','','','iqua，2004年成立于芬兰。继承了芬兰把自然界无缝融入到日常生活中设计精髓，注重细节，让你时刻体验音乐的纯净。我们面向未来，在Audio领域持续革新和创新技术，不仅仅提供出色的产品，更使你能够体验纯净的生活方式，放飞自我，创造属于自己的聆听方式。在iqua，无论你走到哪里，它都与你如影随形，自由自然，灵动聆听。',0,'/list-38.html',2,99,1,1,'admin',1508123018,1508123018,0,0,0,0,0,0,''),(3,49,0,'video1','','/uploads/content/2017/10/59f1552a1ccfe.jpg','','','',0,'/uploads/content/2017/10/59dc5a01834c8.mp4',1,99,1,1,'admin',1508123161,1508123161,0,0,0,0,0,0,'/uploads/content/2017/10/59dc5a01834c8.mp4'),(4,49,0,'4','','/uploads/content/2017/10/59f156b59efe1.jpg','','','1',0,'/show-49-4.html',4,1,1,0,'admin',1508988600,1508988600,0,0,0,0,0,0,'');
