INSERT INTO `iq_page` VALUES (37,'BRAND STORY','','BRAND STORY','<p>1<br/></p>','',1507544090),(38,'BRAND STORY','','','<p style=\"text-align: left; margin-top: 10px; margin-bottom: 10px; text-indent: 2em; line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 20px; color: rgb(0, 0, 0);\">Welcome to the iqua family. iqua Creative Technology is the premier provider of the most comprehensive line for the audio lifestyle. </span></p><p style=\"text-align: left; margin-top: 10px; margin-bottom: 10px; text-indent: 2em; line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 20px; color: rgb(0, 0, 0);\"><br/></span></p><p style=\"text-align: left; margin-top: 10px; margin-bottom: 10px; text-indent: 2em; line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 20px; color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 19px;\">Born in Finland. iqua stands for “Innovation · Quality · User · Audio ” a mantra that has been fully validated not only by our</span><strong><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 19px;\">&nbsp;</span></strong><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 19px;\">iF, Good Design and Red Dot awards, but also by countless media accolades and a whole host of satisfied customers.</span></span></p><p style=\"text-align: left; margin-top: 10px; margin-bottom: 10px; text-indent: 2em; line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 20px; color: rgb(0, 0, 0);\"><br/></span></p><p style=\"text-align: left; margin-top: 10px; margin-bottom: 10px; text-indent: 2em; line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 20px; color: rgb(0, 0, 0);\">By providing a\r\n constant stream of new and innovative products with quality and value, \r\niqua is the perfect selection for your music lifestyle needs. <br/></span></p><p style=\"text-align: left; margin-top: 10px; margin-bottom: 10px; text-indent: 2em; line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 20px; color: rgb(0, 0, 0);\"><br/></span></p><p style=\"text-align: left; margin-top: 10px; margin-bottom: 10px; text-indent: 2em; line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 20px; color: rgb(0, 0, 0);\">iqua&#39;s commitment to innovation sets us apart. Our products are designed in-house by a talented team of industrial designers and engineers, who also meticulously manage the technology to ensure the highest quality, making iqua products distinct in both design and quality. We operate on a “speed to market” philosophy, which emphasizes procedural efficiency so we can bring our innovative products to consumers ahead of our competitors. The combination of all these factors has made us the brand of choice among consumers who recognize quality design, engineering and value.</span></p><p style=\"text-align: left; margin-top: 10px; margin-bottom: 10px; text-indent: 2em; line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 20px; color: rgb(0, 0, 0);\"><br/></span></p><p style=\"text-align: left; margin-top: 10px; margin-bottom: 10px; text-indent: 2em; line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 20px; color: rgb(0, 0, 0);\">Iqua has developed innovative headset design and hands-free devices for consumers in more than 25 countries around the world. Combined with the latest technological level of modernization, Finnish designers&#39; cutting-edge technology, iqua enhances personal communication with new mobile wireless devices.</span></p><p style=\"text-align: left; margin-top: 10px; margin-bottom: 10px; text-indent: 2em; line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 20px; color: rgb(0, 0, 0);\"><br/></span></p><p style=\"text-align: left; margin-top: 10px; margin-bottom: 10px; text-indent: 2em; line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 20px; color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 19px;\">&nbsp;In mobile devices, groundbreaking introduction of solar technology and Bluetooth technology. With the beginning of iquaSUN, the world&#39;s first solar headset in 2008 quickly come to the fore, as many different&nbsp;</span><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 19px; text-align: justify;\">brands of wireless devices on the market leader.</span></span></p><p style=\"text-align: left; margin-top: 10px; margin-bottom: 10px; text-indent: 2em; line-height: 2em;\"><span style=\"text-align: justify; font-family: 微软雅黑,Microsoft YaHei; font-size: 20px; color: rgb(0, 0, 0);\"><br/></span></p><p style=\"text-align: left; margin-top: 10px; margin-bottom: 10px; text-indent: 2em; line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 20px; color: rgb(0, 0, 0);\">Products in the design more emphasis on comfort, ease of use and beauty. iqua is committed to a more environmentally friendly and innovative innovation for consumers around the world.</span></p><p style=\"text-align: left; margin-top: 10px; margin-bottom: 10px; text-indent: 2em; line-height: 2em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 20px; color: rgb(0, 0, 0);\"><br/></span></p><p><br/></p>','',1507611060),(40,'OUR BRAND','','','','',1507620340),(50,'CONTACT US','','','<p style=\"line-height: 3em; text-align: center;\"><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 20px;\"><br/></span></p><p style=\"line-height: 3em;\"><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 20px;\"><br/></span></p><p style=\"line-height: 3em;\"><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 20px;\"><br/></span></p><p style=\"line-height: 3em;\"><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 20px;\"><br/></span></p><p style=\"line-height: 3em; text-align: center;\"><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 20px;\">If you have any questions regarding out products and website, please cantact us:</span></p><p style=\"line-height: 3em; text-align: center;\"><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 20px;\">Tel: +86 755 16885688</span></p><p style=\"line-height: 3em; text-align: center;\"><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 20px;\">Email:service@iqua.com</span></p><p style=\"line-height: 3em; text-align: center;\"><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 20px;\">ShenZhen Lanbo Electronic Commerce Co.,LTD</span></p><p style=\"line-height: 3em; text-align: center;\"><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 20px;\">Yunchuang,cross-bordere-commerce,park1-401 ,bantian street,Longgang District,Shenzhen,China</span></p>','',1508928275),(46,'WELCOME TO IQUA SUPPORT','','','<p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 24px; font-family: 微软雅黑,Microsoft YaHei;\"><strong><span style=\"font-size: 24px; color: rgb(0, 0, 0);\"></span></strong></span></p><h2><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 52px;font-weight:normal;\">Welcome to iqua !</span><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 52px;\"><br/></span></h2><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 24px; font-family: 微软雅黑,Microsoft YaHei;\"><strong><span style=\"font-size: 24px; color: rgb(0, 0, 0); font-family: Arial;\"><br/></span></strong></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei; color: rgb(0, 0, 0); font-size: 24px;\"><span style=\"color: rgb(0, 0, 0); font-family: Arial;\">Connect the device to Bluetooth</span></span></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><br/><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei; color: rgb(0, 0, 0); font-size: 24px;\"><span style=\"color: rgb(0, 0, 0); font-family: Arial;\"></span></span><span style=\"font-family: 微软雅黑,Microsoft YaHei; color: rgb(0, 0, 0);\"><strong><span style=\"font-family: Arial; font-size: 21px;\"></span></strong></span></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\">The iqua device can identify and connect to multiple devices,</span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\">but it always tries to connect to the last used device, with the exception of the prompt.</span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\"><br/></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\">Each product is different in the way you turn on Bluetooth,</span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\">but the operation in Andrews or the Apple operating system is the same.</span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size: 20px; color: rgb(0, 0, 0); font-family: 微软雅黑,Microsoft YaHei;\"><br/></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 24px; font-family: 微软雅黑,Microsoft YaHei;\"><span style=\"font-size: 24px; color: rgb(0, 0, 0); font-family: Arial; letter-spacing: 0px; background-image: none; background-repeat: repeat; background-attachment: scroll; background-clip: border-box; background-origin: padding-box; background-position: 0% 0%; background-size: auto auto;\">Android</span></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\">1. Go to“<span style=\"font-size: 18px; color: rgb(0, 0, 0); font-family: Calibri;\">Settings</span>” <span style=\"font-size: 18px; color: rgb(0, 0, 0); font-family: Calibri;\">&gt; </span>“<span style=\"font-size: 18px; color: rgb(0, 0, 0); font-family: Calibri;\">Wireless &amp; Network</span>”<span style=\"font-size: 18px; color: rgb(0, 0, 0); font-family: Calibri;\">&gt; </span>“<span style=\"font-size: 18px; color: rgb(0, 0, 0); font-family: Calibri;\">Bluetooth </span>”<span style=\"font-size: 18px; color: rgb(0, 0, 0); font-family: Calibri;\">settings.</span></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\"><br/></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\">2. Select the box next to “<span style=\"font-size: 20px; color: rgb(0, 0, 0); font-family: Calibri;\">Bluetooth</span>”<span style=\"font-size: 20px; color: rgb(0, 0, 0); font-family: Calibri;\">to turn on the Bluetooth function.</span></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\"><br/></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\">3. The Bluetooth device list will be displayed.</span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\"><br/></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\">4. Tap the iqua product model in the list for pairing.</span></p><p><span style=\"font-size: 20px; color: rgb(0, 0, 0); font-family: 微软雅黑,Microsoft YaHei;\"><br/></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size: 20px; color: rgb(0, 0, 0); font-family: 微软雅黑,Microsoft YaHei;\"></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 24px; font-family: 微软雅黑,Microsoft YaHei;\"><span style=\"font-size: 24px; color: rgb(0, 0, 0); font-family: Arial;\">Apple iOS</span></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\">1. Go to “<span style=\"font-size: 18px; color: rgb(0, 0, 0); font-family: Calibri;\">Settings</span>”<span style=\"font-size: 18px; color: rgb(0, 0, 0); font-family: Calibri;\">&gt;</span>“ <span style=\"font-size: 18px; color: rgb(0, 0, 0); font-family: Calibri;\">Bluetooth</span>”<span style=\"font-size: 18px; color: rgb(0, 0, 0); font-family: Calibri;\">.</span></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\"><br/></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\">2. Move the “<span style=\"font-size: 20px; color: rgb(0, 0, 0); font-family: Calibri;\">Bluetooth</span>” <span style=\"font-size: 20px; color: rgb(0, 0, 0); font-family: Calibri;\">slider to the </span>“<span style=\"font-size: 20px; color: rgb(0, 0, 0); font-family: Calibri;\">ON</span>” <span style=\"font-size: 20px; color: rgb(0, 0, 0); font-family: Calibri;\">position.</span></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\"><br/></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\">3. The Bluetooth device list will be displayed.</span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\"><br/></span></p><p style=\";text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0); font-size: 18px; font-family: 微软雅黑,Microsoft YaHei;\">4. Tap the iqua product model in the list for pairing.</span></p><p><span style=\"color: rgb(0, 0, 0); font-size: 20px; font-family: 微软雅黑,Microsoft YaHei;\"><br/></span></p>','',1507716240),(45,'WELCOME TO IQUA SUPPORT','','','<p><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><span style=\"font-size: 36px; color: rgb(0, 0, 0);\"></span></span></p><h2><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 52px;font-weight:normal;\">Welcome to iqua !</span><span style=\"font-family: 微软雅黑,Microsoft YaHei; font-size: 52px;\"><br/></span></h2><p><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><span style=\"font-size: 36px; color: rgb(0, 0, 0);\"></span></span><br/></p><p><span style=\"font-family: 微软雅黑,Microsoft YaHei;\"><span style=\"font-size: 36px; color: rgb(0, 0, 0);\">We are always ready to help you</span><span style=\"color: rgb(0, 0, 0);\"><br/><br/>We strive to solve your problems quickly in a professional way. Our online support website provides solutions for most product issues, or you can contact the iqua support team for assistance.<br/><br/><span style=\"color: rgb(0, 0, 0); font-size: 24px;\">Warranty Policy</span><br/><br/>1. With warranty card and purchase voucher (sales invoice or machine ticket) to prove that iqua approved sales channels to buy the product, during the warranty period to enjoy free maintenance replacement service.<br/><br/>2. iqua products purchased in various regions of the world, if there is purchasing, transit or product entry does not comply with the relevant customs regulations do not enjoy free warranty service, please contact the customer service center.<br/><br/>3.iqua statement of the warranty does not apply to the following circumstances:<br/><br/>* Warranty registration certificate and valid invoice.<br/><br/>* Non-iqua authorized repair center for disassembly caused damage.<br/><br/>* Failure to use the product manual to require damage, use, maintenance, storage and damage.<br/><br/>* Damage, loss or alteration of the information code (two-dimensional code, bar code, etc.) on the product or any damage caused by any human factors and force majeure.(Such as fires, earthquakes, typhoons, etc.) or pests, etc., due to improper use or inadvertent accidents, such as improper maintenance and storage, accidents (such as fire, flooding, external squeezing and falling), natural disasters Caused by the failure or damage.<br/><br/>4. Other unspecified items shall be implemented in accordance with national regulations.<br/><br/><span style=\"color: rgb(0, 0, 0); font-size: 24px;\">warranty service</span><br/><br/>One year limited warranty applies to all iqua headphones purchased from authorized dealers.<br/><br/></span></span></p>','',1507716558),(47,'Mac issues with Bluetooth','','','<p>Having trouble connecting your Apple products to Beats via Bluetooth? Follow these steps:</p><p><br/></p><ol class=\" list-paddingleft-2\"><li><p>Disable Bluetooth on any devices linked to your Beats.</p></li><li><p>Open the Bluetooth menu from System Preferences on your Mac.</p></li><li><p>Select your Beats from the list of found devices and remove it.</p></li><li><p>Activate pairing on your Beats.</p></li><li><p>Check the LED lights to ensure it’s in pairing mode.</p></li><li><p>Go back to the Mac Bluetooth menu and select your Beats device.</p></li><ul class=\" list-paddingleft-2\"><li><p>On OS X 10.8, you&#39;ll need to select your Beats as your audio device under Bluetooth Preferences.</p></li></ul><li><p>You’re paired! But you may need to reconnect. Select your Beats in the Bluetooth menu and choose Use as Audio Device (stereo).</p></li></ol><p>Audio will now stream properly through your Beats. If you’re still stuck, try restarting your Mac.</p><p><br/></p><p><br/></p>','',1507799702),(48,'Bluetooth and your device','','','<p>Beats devices can recognize connections with several devices, but \r\nthey will always try to connect with the last device used unless \r\nprompted otherwise.</p><p><br/></p><p>Initiating Bluetooth is different on each product, but it’s generally\r\n the same within Android or Apple operating systems. Here’s how to pair \r\neach:</p><p><br/></p><h4>Android</h4><ol class=\" list-paddingleft-2\"><li><p>Go to Settings &gt; Wireless &amp; Networks &gt; Bluetooth settings.</p></li><li><p>Check the box next to Bluetooth to turn Bluetooth on.</p></li><li><p>A list of Bluetooth devices will appear.</p></li><li><p>Tap your Beats product in the list to connect.</p></li></ol><p><br/></p><h4>Apple iOS</h4><ol class=\" list-paddingleft-2\"><li><p>Go to Settings &gt; Bluetooth.</p></li><li><p>Move the Bluetooth slider to On.</p></li><li><p>A list of Bluetooth devices will appear.</p></li><li><p>Tap your Beats product in the list to connect.</p></li></ol><p><br/></p><p><br/></p>','',1507799881),(52,'PRIZE','','','','',1509439307);
